import React from "react";

const Home = () => (
  <div className="container-fluid">
    <h1 className="title is-1">Books are Tiiight</h1>
    <section>
      <p>do you love books? <br></br> well you are in luck <br></br> check out the search link and find the book you have always loved <br></br>
      from the classics like moby dic to the new new like hary potter <br></br> cozy up with that coffee </p>
    </section>
    
  </div>
);

export default Home;
